ontology_addendum.graph:
@prefix co: <https://example.com/ont_cryogenics#> .
@prefix dcterms: <http://purl.org/dc/terms/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

co:CoolingTechnique a rdfs:Class ;
    rdfs:label "Cooling Technique" ;
    rdfs:comment "Methods used to achieve low temperatures in cryogenic experiments." .

co:Cryogenics a rdfs:Class ;
    rdfs:label "Cryogenics" ;
    rdfs:comment "A field of physics that studies the behavior of materials at low temperatures." .

co:Material a rdfs:Class ;
    rdfs:label "Material" ;
    rdfs:comment "Substances or components used in cryogenic experiments." .

co:QuantumFluids a rdfs:Class ;
    rdfs:label "Quantum Fluids" ;
    rdfs:comment "Fluids that exhibit quantum mechanical effects at macroscopic scales, typically at low temperatures." ;
    rdfs:subClassOf co:Cryogenics .

co:Superconductivity a rdfs:Class ;
    rdfs:label "Superconductivity" ;
    rdfs:comment "A phenomenon where a material exhibits zero electrical resistance and expulsion of magnetic fields at low temperatures." ;
    rdfs:subClassOf co:Cryogenics .

<https://example.com/ont_cryogenics> a owl:Ontology ;
    rdfs:label "Cryogenics Ontology" ;
    dcterms:description "The Cryogenics Ontology provides a structured representation of concepts and relationships in the field of low-temperature physics, particularly focusing on superconductivity and quantum fluids. It aims to facilitate the sharing and integration of knowledge related to cryogenic materials, experimental techniques, and fundamental properties of quantum materials at ultra-low temperatures." ;
    dcterms:title "cryogenics" ;
    rdfs:comment "The Cryogenics Ontology provides a structured representation of concepts and relationships in the field of low-temperature physics, particularly focusing on superconductivity and quantum fluids. It aims to facilitate the sharing and integration of knowledge related to cryogenic materials, experimental techniques, and fundamental properties of quantum materials at ultra-low temperatures." ;
    owl:versionInfo "1.0.0" .

co:Temperature a rdf:Property ;
    rdfs:label "Temperature" ;
    rdfs:comment "The measure of thermal energy of a system, relevant in cryogenics for studying material properties." ;
    rdfs:domain co:Material ;
    rdfs:range xsd:float .

co:hasSuperconductingTransitionTemperature a rdf:Property ;
    rdfs:label "has Superconducting Transition Temperature" ;
    rdfs:comment "The temperature at which a material transitions to a superconducting state." ;
    rdfs:domain co:Material ;
    rdfs:range xsd:float .

co:usesCoolingTechnique a rdf:Property ;
    rdfs:label "uses Cooling Technique" ;
    rdfs:comment "Relates a material to the cooling technique used to achieve its low temperature state." ;
    rdfs:domain co:Material ;
    rdfs:range co:CoolingTechnique .
